{"result":"@-moz-document url(https://tests.peter.sh/notification-generator/) {
  /* Add a background color to the body */
  body {
    background-color: #f0f0f0;
    font-family: 'Roboto', sans-serif;
    margin: 0;
    padding: 0;
  }

  /* Style the header */
  header {
    background-color: #3498db;
    color: #fff;
    text-align: center;
    padding: 20px;
  }

  /* Style the h1 element in the header */
  header h1 {
    margin: 0;
    font-size: 28px;
  }

  /* Style the links in the header */
  header a.twitter {
    color: #55acee;
    text-decoration: none;
    margin-left: 10px;
  }

  /* Style the section containing the content */
  section {
    background-color: #fff;
    margin: 20px;
    padding: 20px;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.2);
  }

  /* Style the buttons at the bottom */
  button {
    background-color: #3498db;
    color: #fff;
    border: none;
    padding: 10px 20px;
    margin: 5px;
    cursor: pointer;
    transition: background-color 0.3s;
  }

  /* Change button color on hover */
  button:hover {
    background-color: #1d6fa5;
  }
}
"}
